import Part from "./components/Part";

const Content = (props) => {
    return ( 
        <>
        <Part
        part={props.part1}
        exercise={props.exercises1}
        />
        <p>
        {props.part1} {props.exercises1}
      </p>
      <p>
        {props.part2} {props.exercises2}
      </p>
      <p>
        {props.part3} {props.exercises3}
      </p>
        </>
     );
}

export default Content;
